import React from 'react'; 
//Components
import CreateAccountForm from "../components/CreateAccountForm";

function CreateAccount({CreateAccountFunction}) {
    return(
        <div className="Wrapper">
            <p className="welcomePillar">WELCOME TO PILLAR.</p>
            <div className="CreateWrapper CreateForm">
            <CreateAccountForm CreateAccountFunction={CreateAccountFunction}/>
            <div className="CreateInformation">
                <p className="CreateTitle">About Pillar</p>
                <p>Pillar is a social media platform that allows people to share and generate content related to fitness</p>
                <ul>
                <li>Track your workouts </li>
                <li>Follow your favourite athletes </li>
                <li>Generate your own workouts to share</li>
                </ul>
                </div>
            </div>
            </div>
    )
}

export default CreateAccount;
